import React from 'react';
import { Container } from './styled';

const TabelaCampeonato = () => {
    return (
        <Container>
            <table>
                <tr>
                    <th>Time</th>
                    <th>Pontos</th>
                    <th>Jogos</th>
                    <th>Gols</th>
                </tr>
                <tr>
                    <td>teste</td>
                </tr>
            </table>
        </Container>     
    );
}

export default TabelaCampeonato;
